import { apiURL, post, get } from "./util"

export async function getBooks(keyword, pageIndex, pageSize) {
  let res = await get(`${apiURL}/books?keyword=${keyword}&pageIndex=${pageIndex}&pageSize=${pageSize}`),
    bookList = []
}
